        private void ValidateForm()
        {
            // Obtengo los valores ingresados en los campos
            string nombre = txtNombre.Text;
            string apellido = txtApellidos.Text;
            string email = txtEmail.Text;
            string ciudad = txtCiudad.Text;
            string dni = txtDni.Text;
            DateTime? fechaSeleccionada = txtDate.SelectedDate;
            bool isRolSelected = txtRol.SelectedItem != null;
            bool isFotoCargada = imagenCargadaBytes != null;

            // Valido
            bool isNombreValid = IsValidField(nombre);
            bool isApellidoValid = IsValidField(apellido);
            bool isEmailValid = IsValidEmail(email);
            bool isCiudadValid = IsValidField(ciudad);
            bool isDniValid = IsValidDniNie(dni);
            bool isFechaValid = fechaSeleccionada.HasValue;
            bool isRolValid = isRolSelected;

            // Muestro u oculto el mensaje de error para el campos dependiendo de su validez
            ErrorTextNombre.Visibility = isNombreValid ? Visibility.Collapsed : Visibility.Visible;
            ErrorTextApellidos.Visibility = isApellidoValid ? Visibility.Collapsed : Visibility.Visible;
            ErrorTextEmail.Visibility = isEmailValid ? Visibility.Collapsed : Visibility.Visible;
            ErrorTextCiudad.Visibility = isCiudadValid ? Visibility.Collapsed : Visibility.Visible;
            ErrorTextDate.Visibility = isFechaValid ? Visibility.Collapsed : Visibility.Visible;
            ErrorTextRol.Visibility = isRolValid ? Visibility.Collapsed : Visibility.Visible;
            ErrorTextDni.Visibility = isDniValid ? Visibility.Collapsed : Visibility.Visible;
            ErrorTextFoto.Visibility = isFotoCargada ? Visibility.Collapsed : Visibility.Visible;

            // Habilito el botón de inicio de sesión solo si ambos campos son válidos
            btnGuardarPerfil.IsEnabled = isNombreValid && isApellidoValid && isEmailValid && isCiudadValid && isDniValid && isFechaValid && isRolValid && isFotoCargada;

        }

        public bool IsValidField(string field)
        {

            //Si no es nula regreso false
            if (string.IsNullOrWhiteSpace(field))
                return false;

            //Si al menos tiene 3 letras el campo es valido
            return field.Length > 2 ? true : false;
        }

        public bool IsValidEmail(string email)
        {

            //Si no es nula regreso false
            if (string.IsNullOrWhiteSpace(email))
                return false;

            // Expresión regular para validar un email, se agrega using System.Text.RegularExpressions;
            //Explicación del patter al final del documento.
            string pattern = @"^[^@\s]+@[^@\s]+\.[^@\s]+$";
            return Regex.IsMatch(email, pattern);
        }
        public static bool IsValidDniNie(string input)
        {
            // Patrón para DNI: 8 dígitos seguidos de una letra
            string patronDni = @"^\d{8}[A-Za-z]$";

            // Patrón para NIE: Letra inicial (X, Y, Z), 7 dígitos y una letra
            string patronNie = @"^[XYZ]\d{7}[A-Za-z]$";

            // Verificar si cumple con el formato de DNI o NIE
            if (Regex.IsMatch(input, patronDni) || Regex.IsMatch(input, patronNie))
            {
                // Validar la letra del DNI o NIE
                return ValidarLetraDniNie(input);
            }
            return false;
        }

        private static bool ValidarLetraDniNie(string input)
        {
            // Extraer números del DNI o NIE
            string numeros;
            if (input[0] == 'X')
                numeros = "0" + input.Substring(1, 7); // Reemplazar X por 0
            else if (input[0] == 'Y')
                numeros = "1" + input.Substring(1, 7); // Reemplazar Y por 1
            else if (input[0] == 'Z')
                numeros = "2" + input.Substring(1, 7); // Reemplazar Z por 2
            else
                numeros = input.Substring(0, 8); // Es un DNI

            // Calcular letra esperada
            string letras = "TRWAGMYFPDXBNJZSQVHLCKE";
            int indice = int.Parse(numeros) % 23;
            char letraEsperada = letras[indice];

            // Comparar con la letra del DNI o NIE
            return char.ToUpper(input.Substring(input.Length - 1, 1)[0]) == letraEsperada;

        }

        private async void btnCargarImg_Click(object sender, RoutedEventArgs e)
        {
            Microsoft.Win32.OpenFileDialog dlg = new Microsoft.Win32.OpenFileDialog();
            dlg.DefaultExt = ".png"; // Filtro de extensiones para el cuadro de diálogo
            dlg.Filter = "Archivos de imagen (*.png;*.jpeg;*.jpg)|*.png;*.jpeg;*.jpg";
            if (dlg.ShowDialog() == true)
            {
                try
                {
                    // Obtener la ruta del archivo seleccionado por el usuario
                    string filePath = dlg.FileName;

                    // Leer los datos del archivo
                    imagenCargadaBytes = File.ReadAllBytes(filePath);
                    // Convertir los datos del archivo a Base64
                    // base64String = Convert.ToBase64String(fileBytes);
                    base64String = await Task.Run(() => Convert.ToBase64String(imagenCargadaBytes));




                    BitmapImage bitmapImage = new BitmapImage();
                    bitmapImage.BeginInit();
                    bitmapImage.UriSource = new Uri(dlg.FileName);
                    bitmapImage.EndInit();
                    miEllipse.Fill = new ImageBrush(bitmapImage);
                    ValidateForm();

                }
                catch (Exception ex)
                {
                    MessageBox.Show($"Ocurrió un error al cargar la imagen: {ex.Message}", "Error", MessageBoxButton.OK, MessageBoxImage.Error);

                }

            }
        }

        private async void btnGuardarPerfil_Click(object sender, RoutedEventArgs e)
        {
            var viewModel = new RegistroPerfilViewModel();

            ComboBoxItem itemSeleccionado = (ComboBoxItem)txtRol.SelectedItem;
            string rolSeleccionado = itemSeleccionado.Content.ToString();
            string sexo;


            if ((bool)!rb49.IsChecked && (bool)!rbH.IsChecked)
            {
                sexo = "Mujer";

            }
            else if ((bool)!rb49.IsChecked && (bool)!rbM.IsChecked)
            {
                sexo = "Hombre";
            }
            else
            {
                sexo = "Indeterminado";
            }

              

            try
            {
                var formData = new MultipartFormDataContent
                {

                    //// Agregar los campos del formulario a la petición
                    { new StringContent(""), "_id" },
                    { new StringContent(IdUsuario), "idUsuario" },
                    { new StringContent(txtNombre.Text.Trim()), "nombre" },
                    { new StringContent(txtApellidos.Text.Trim()), "apellido" },
                    { new StringContent(txtEmail.Text.Trim()), "email" },
                    { new StringContent(rolSeleccionado), "rol" },
                    { new StringContent(sexo), "sexo" },
                    { new StringContent(txtDni.Text.Trim()), "dni" },
                    { new StringContent(txtDate.Text.Trim()), "date"},
                    { new StringContent(txtCiudad.Text.Trim()), "ciudad"},


                };

                // Verificar si la imagen ha sido cargada
                if (imagenCargadaBytes != null)
                {
                    // Convertir los datos de la imagen a ByteArrayContent
                    ByteArrayContent imagenContent = new ByteArrayContent(imagenCargadaBytes);
                    // Agregar la imagen al contenido
                    formData.Add(imagenContent, "picture", "imagen.jpg");
                }
                else
                {
                    MessageBox.Show("Primero carga una imagen.", "Error", MessageBoxButton.OK, MessageBoxImage.Error);
                    return;
                }

                var contentString = await formData.ReadAsStringAsync();
                MessageBox.Show(contentString);

                // Enviar la solicitud POST al servidor
                var response = await viewModel.RegistrarPerfil(formData, rolSeleccionado);
                // Leer la respuesta del servidor
                var result = await response.Content.ReadAsStringAsync();

                Debug.WriteLine($"Status: {response.StatusCode} \nContenido: {result}");

                // Manejar la respuesta del servidor
                if (response.IsSuccessStatusCode)
                {
                    // Convertir la respuesta JSON a un objeto dynamic
                    dynamic responseData = JsonConvert.DeserializeObject<dynamic>(result);

                    if (responseData != null)
                    {

                        MessageBox.Show($"Data : {responseData}","Perfil Creado", MessageBoxButton.OK, MessageBoxImage.Information);

                        if (Privileges == null) {
                            CargaUsuariosSession();
                        }
                        else if (Privileges != null) {
                            SettingsData.Default.token = responseData.token;
                            SettingsData.Default.appToken = responseData.appToken;
                            SettingsData.Default.idPerfil = responseData.data.user._id;
                            SettingsData.Default.rol = responseData.data.user.rol;
                            SettingsData.Default.nombre = responseData.data.user.nombre;
                            SettingsData.Default.Save();



                            //Inicio user = new Inicio();
                            //user.Show();
                            this.Close();
                        }
                        this.Close();
                    }
                    else
                    {
                        // Manejar el caso en que responseData es nulo
                        var error = JsonConvert.DeserializeObject<dynamic>(result);
                        MessageBox.Show(error + " = ERROR 500");

                    }
                }
                else
                {
                    // La solicitud no fue exitosa, manejar el error
                    var error = JsonConvert.DeserializeObject<dynamic>(result);
                    MessageBox.Show(error + " = ERROR 404");
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show($"Ocurrió un error al cargar los datos : {ex.Message}", "Error 500", MessageBoxButton.OK, MessageBoxImage.Error);
            }
        }

        private async void btnCerrar_Click(object sender, RoutedEventArgs e)
        {
            var confirmacion = MessageBox.Show(
               "Estas seguro que quieres cerrar ?",
               "Se va a eliminar el usuario ya registrado...",
               MessageBoxButton.YesNo,
               MessageBoxImage.Question);

            if (confirmacion == MessageBoxResult.Yes)
            {
                var viewModelCodigoVerificacion = new CodigoVerificacionViewModel();
  
                var response = await viewModelCodigoVerificacion.EliminarUsuario(EmailApp);

                var result = await response.Content.ReadAsStringAsync();

                if (response.IsSuccessStatusCode)
                {
                    var status = JsonConvert.DeserializeObject(result);
                    MessageBox.Show(
                    $"usuario Eliminado. {status}",
                    "Status : 200",
                    MessageBoxButton.OK,
                    MessageBoxImage.Information
                    );
                    this.Close();
                }
                else
                {
                    var error = JsonConvert.DeserializeObject(result);
                    MessageBox.Show(
                        $"Error al eliminar el usuario. {error}",
                        "Error : 500",
                        MessageBoxButton.OK,
                        MessageBoxImage.Error
                        );

                }

            }
        }

        private async void CargaUsuariosSession()
        {


            var ex = await _viewModel.CargarTodosLosUsuarios();
            if (ex == SettingsData.Default._200)
                return;
            else if (ex != SettingsData.Default._419)
            {
                Notificacion notEx = new Notificacion("Error", ex);
                notEx.Owner = this;
                notEx.ShowDialog();
                InicioDeSesion.LogIn logEx = new InicioDeSesion.LogIn();
                logEx.Show();
                this.Close();
            }
            else
            {
                Notificacion not = new Notificacion("Session Terminada", "Por favor inicie session.");
                not.Owner = this;
                not.ShowDialog();
                InicioDeSesion.LogIn log = new InicioDeSesion.LogIn();
                log.Show();
                this.Close();
            }
        }
